import React, { useState, useEffect } from 'react';
import {
  Grid,
  Paper,
  Typography,
  Box,
  Card,
  CardContent,
  CardHeader,
  Tab,
  Tabs,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Divider
} from '@mui/material';
import {
  Assignment as TicketIcon,
  People as PeopleIcon,
  Warning as UrgentIcon,
  CheckCircle as ResolvedIcon,
  History as HistoryIcon,
  SupervisorAccount as ClientsIcon,
  Dashboard as DashboardIcon
} from '@mui/icons-material';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import TicketList from '../../components/tickets/TicketList';
import { API_URL, ADMIN_ENDPOINTS } from '../../utils/apiConfig';
import { useTickets } from '../../contexts/TicketContext';

const StatCard = ({ title, value, icon, color }) => (
  <Card sx={{ height: '100%' }}>
    <CardContent>
      <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
        {React.cloneElement(icon, { sx: { color, mr: 1 } })}
        <Typography color="textSecondary" variant="h6">
          {title}
        </Typography>
      </Box>
      <Typography variant="h4">{value}</Typography>
    </CardContent>
  </Card>
);

const ActionCard = ({ title, description, icon, color, onClick }) => (
  <Card sx={{ height: '100%', cursor: 'pointer' }} onClick={onClick}>
    <CardContent>
      <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
        {React.cloneElement(icon, { sx: { color, mr: 1 } })}
        <Typography color="textSecondary" variant="h6">
          {title}
        </Typography>
      </Box>
      <Typography variant="body2">{description}</Typography>
    </CardContent>
  </Card>
);

const AdminDashboard = () => {
  const [tabValue, setTabValue] = useState(0);
  const [stats, setStats] = useState({
    totalTickets: 0,
    openTickets: 0,
    resolvedTickets: 0,
    urgentTickets: 0,
    technicians: 0,
    clients: 0
  });
  const [tickets, setTickets] = useState([]);
  const [assignTechDialogOpen, setAssignTechDialogOpen] = useState(false);
  const [technicians, setTechnicians] = useState([]);
  const [selectedTechnician, setSelectedTechnician] = useState('');
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();
  const { fetchTickets } = useTickets();

  // Function to get dashboard stats
  const fetchDashboardStats = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.get(ADMIN_ENDPOINTS.DASHBOARD_STATS, {
        headers: {
          Authorization: `Bearer ${token}`
        }
      });
      setStats(response.data);
    } catch (error) {
      console.error('Error fetching dashboard stats:', error);
    }
  };

  // Function to get all tickets
  const fetchAllTickets = async () => {
    try {
      setLoading(true);
      const ticketsData = await fetchTickets();
      // Sort tickets by creation date (newest first)
      const sortedTickets = ticketsData.sort((a, b) => 
        new Date(b.createdAt) - new Date(a.createdAt)
      );
      setTickets(sortedTickets);
    } catch (error) {
      console.error('Error fetching tickets:', error);
    } finally {
      setLoading(false);
    }
  };

  // Function to get all technicians
  const fetchTechnicians = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.get(`${API_URL}/users/technicians`, {
        headers: {
          Authorization: `Bearer ${token}`
        }
      });
      setTechnicians(response.data);
    } catch (error) {
      console.error('Error fetching technicians:', error);
    }
  };

  // Fetch initial data
  useEffect(() => {
    fetchDashboardStats();
    fetchAllTickets();
    fetchTechnicians();
  }, []);

  // Handle tab change
  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  // Handle ticket assignment
  const handleTicketAssigned = () => {
    // Refresh the tickets list after assignment
    fetchAllTickets();
    fetchDashboardStats();
  };

  // Navigation functions
  const navigateToTickets = () => {
    navigate('/admin/tickets');
  };

  const navigateToUsers = () => {
    navigate('/admin/users');
  };

  // Filtering logic for different ticket tabs
  const getFilteredTickets = () => {
    switch (tabValue) {
      case 0: // All Tickets
        return tickets;
      case 1: // Open Tickets
        return tickets.filter(ticket => ticket.status !== 'resolved');
      case 2: // Assigned Tickets
        return tickets.filter(ticket => ticket.assignedTo);
      case 3: // Unassigned Tickets
        return tickets.filter(ticket => !ticket.assignedTo);
      case 4: // Urgent Tickets
        return tickets.filter(ticket => ticket.priority === 'urgent');
      case 5: // Resolved Tickets
        return tickets.filter(ticket => ticket.status === 'resolved');
      default:
        return tickets;
    }
  };

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" sx={{ mb: 3 }}>
        Admin Dashboard
      </Typography>

      {/* Stats Cards */}
      <Grid container spacing={3} sx={{ mb: 3 }}>
        <Grid item xs={12} sm={6} md={4} lg={2}>
          <StatCard
            title="Total Tickets"
            value={stats.totalTickets}
            icon={<TicketIcon />}
            color="primary.main"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={4} lg={2}>
          <StatCard
            title="Open Tickets"
            value={stats.openTickets}
            icon={<HistoryIcon />}
            color="info.main"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={4} lg={2}>
          <StatCard
            title="Urgent Tickets"
            value={stats.urgentTickets}
            icon={<UrgentIcon />}
            color="error.main"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={4} lg={2}>
          <StatCard
            title="Resolved Tickets"
            value={stats.resolvedTickets}
            icon={<ResolvedIcon />}
            color="success.main"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={4} lg={2}>
          <StatCard
            title="Technicians"
            value={stats.technicians}
            icon={<PeopleIcon />}
            color="secondary.main"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={4} lg={2}>
          <StatCard
            title="Clients"
            value={stats.clients}
            icon={<ClientsIcon />}
            color="warning.main"
          />
        </Grid>
      </Grid>

      {/* Quick Actions */}
      <Grid container spacing={3} sx={{ mb: 3 }}>
        <Grid item xs={12} sm={6} md={3}>
          <ActionCard
            title="Manage Tickets"
            description="View and manage all support tickets"
            icon={<TicketIcon />}
            color="primary.main"
            onClick={navigateToTickets}
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <ActionCard
            title="User Management"
            description="Manage technicians and clients"
            icon={<PeopleIcon />}
            color="secondary.main"
            onClick={navigateToUsers}
          />
        </Grid>
      </Grid>

      {/* Tickets Section */}
      <Paper sx={{ p: 2, mb: 3 }}>
        <Typography variant="h6" sx={{ mb: 2 }}>
          Ticket Management
        </Typography>
        <Tabs
          value={tabValue}
          onChange={handleTabChange}
          variant="scrollable"
          scrollButtons="auto"
          sx={{ mb: 2 }}
        >
          <Tab label="All Tickets" />
          <Tab label="Open Tickets" />
          <Tab label="Assigned Tickets" />
          <Tab label="Unassigned Tickets" />
          <Tab label="Urgent Tickets" />
          <Tab label="Resolved Tickets" />
        </Tabs>

        <TicketList 
          tickets={getFilteredTickets()} 
          onTicketUpdated={handleTicketAssigned}
          showAssignButton={true}
        />
      </Paper>
    </Box>
  );
};

export default AdminDashboard;
